import { Component, OnInit } from '@angular/core';
import { User } from 'src/app/models/user.model';

@Component({
  selector: 'app-header',
  templateUrl: './header.component.html',
  styleUrls: ['./header.component.css']
})
export class HeaderComponent implements OnInit {
  user: User = new User();
  notLogged = true;
  isAdmin = false;
  isOwner = false;
  isDecorator = false;

  constructor() {}

  ngOnInit(): void {
    this.user = JSON.parse(localStorage.getItem('user') || '{}');
    if (this.user == null) {
      this.notLogged = true;
      this.isAdmin = false;
      this.isOwner = false;
      this.isDecorator = false;
    }
    if (this.user.userTypeId.userTypeId == 3) {
      this.notLogged = false;
      this.isAdmin = true;
      this.isOwner = false;
      this.isDecorator = false;
    }
    else if (this.user.userTypeId.userTypeId == 1) {
      this.notLogged = false;
      this.isAdmin = false;
      this.isOwner = true;
      this.isDecorator = false;
    }
    else if (this.user.userTypeId.userTypeId == 2) {
      this.notLogged = false;
      this.isAdmin = false;
      this.isDecorator = true;
      this.isOwner = false;
    }

  }

  logout() {
    localStorage.removeItem('user');
  }
}
<nav class="navbar navbar-expand-lg navbar-light bg-light">
  <img class="navbar-brand navbar-logo" src="../../../../assets/photos/Logo.png" alt="Logo">
  <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
    <span class="navbar-toggler-icon"></span>
  </button>
  <div class="collapse navbar-collapse" id="navbarNav">
    <ul class="navbar-nav">
      <!-- NOT LOGGED IN -->
      <li class="nav-item" *ngIf="notLogged">
        <a class="nav-link" href='/home'>Početna</a>
      </li>
      <li class="nav-item" *ngIf="notLogged">
        <a class="nav-link" href='/login'>Uloguj se</a>
      </li>
      <!-- ADMIN -->
      <li class="nav-item" *ngIf="isAdmin">
        <a class="nav-link" href="/admin/users">Upravljanje Korisnicima</a>
      </li>
      <li class="nav-item" *ngIf="isAdmin">
        <a class="nav-link" href="/admin/companies">Upravljanje Kompanijama</a>
      </li>
      <!-- OWNER -->
      <li class="nav-item" *ngIf="isOwner">
        <a class="nav-link" href="/owner/profile">Profil</a>
      </li>
      <li class="nav-item" *ngIf="isOwner">
        <a class="nav-link" href="/owner/companies">Kompanije</a>
      </li>
      <li class="nav-item" *ngIf="isOwner">
        <a class="nav-link" href="/owner/job">Zakazivanja</a>
      </li>
      <li class="nav-item" *ngIf="isOwner">
        <a class="nav-link" href="/owner/maintenance">Održavanje</a>
      </li>
      <!-- DECORATOR -->
      <li class="nav-item" *ngIf="isDecorator">
        <a class="nav-link" href="/decorator/profile">Profil</a>
      </li>
      <li class="nav-item" *ngIf="isDecorator">
        <a class="nav-link" href="/decorator/job">Zakazivanja</a>
      </li>
      <li class="nav-item" *ngIf="isDecorator">
        <a class="nav-link" href="/decorator/maintenance">Održavanje</a>
      </li>
      <li class="nav-item" *ngIf="isDecorator">
        <a class="nav-link" href="/decorator/statistic">Statistika</a>
      </li>
      <!-- LOGGED IN - EVERYONE -->
      <li class="nav-item" *ngIf="!notLogged">
        <a class="nav-link" href="/home" (click)="logout()">Izloguj se</a>
      </li>
    </ul>
  </div>
</nav>
